import React from 'react';
import './assets/styles/index.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>GameKeys</h1>
        <p>Digital Key E-commerce Platform</p>
      </header>
      <main>
        <p>Welcome to GameKeys! Your one-stop shop for digital game keys.</p>
      </main>
    </div>
  );
}

export default App;
